import React from "react";
import FlipCard from '../FlipCard'
import Road from "../Road"
import {Bar, Doughnut, Polar, Radar, HorizontalBar} from 'react-chartjs-2';


function RoadLevel3(props) {


    return (
        <div>
            
            <div style = {{display: 'flex', flexDirection: 'row', marginLeft:'9.5em', marginTop:'1.6em'}}>
            <Road 
                width={'10em'}
                height= {'10em'}
                StylingInfo = {'horizontal-road1'} 
                dashType = 'horizontal-dash'/>
                            
                <FlipCard
                  width = {"25em"}
                  height = {"20em"}
                  FlipStyle = {{backgroundImage:'url("/webDev.jpg")',
                  backgroundSize:'100%',
                  backgroundRepeat: 'no-repeat',
                  backgroundPosition: 'center'
                }}
                  // Front=
                  // {
                  //   <div>
                  //     <h1 className = 'progLang-hF'>
                  //     {props.webDevChartData.frontTitle}
                  //     </h1>
                  //   </div>
                  // }
                  Back = {
                    <div>
                      <Doughnut data={props.webDevChartData.webDevChartData}
                        options= {props.webDevChartData.options}
                      />
                    </div>
                      }
                >
                </FlipCard>
                
                <Road 
                width={'10em'}
                height= {'10em'}
                StylingInfo = {'horizontal-road1'}
                dashType = 'horizontal-dash'
                />
            <Road 
                width={'10em'}
                height= {'10em'}
                StylingInfo = {'horizontal-road1'} 
                dashType = 'horizontal-dash'/>
            </div>
            </div>
        )              
}

export default RoadLevel3;
